import React from 'react';
import Hikaye from '../data/hikaye.json';


const HomeInstagram = () => {
    return (
        <div className='flex items-center'>
            <div className='w-[66px] h-[66px] rounded-full'>
                <img src={Hikaye?.image} alt='' className='w-14 h-14 object-contain' />
                <span>{Hikaye?.title}</span>
            </div>
        </div>
    );
};

export default HomeInstagram;
